    async Task Delete(long id)
    {
        if (strDelete == true)
        {
            bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Are you sure?");
            if (confirmed)
            {
                view = salesRepository.EditsalesMaster(id);
                bool isSave = false;
                isSave = salesRepository.DeleteSlesInvoice(id, view.VoucherNo, view.CompanyId, view.FinancialYearId);
                if (isSave == true)
                {
                    Toaster.Add("Delete Successfully.", MatToastType.Info, "SalesInvoice", null);
                    LoadData();
                    navManager.NavigateTo("inventory/salesinvoicelist");
                }
                else
                {
                    Toaster.Add("Cannot be delete. already in used.", MatToastType.Warning, "SalesInvoice", null);
                    navManager.NavigateTo("inventory/salesinvoicelist");
                }
            }
        }
        else
        {
            Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
            navManager.NavigateTo("dashboard");
        }
